import React from "react";

export default function Info(props) {
    return (
        <div className="info">
            <div className="info-desc">
                <div className="info-name">Denis Novik</div>
            </div>
            <div className="info-img">
                <img src={props.img} alt=""></img>
            </div>
        </div>
    )
}
